/**
 * Payment Configuration Module
 * 
 * Manages payment provider settings, API keys, and environment-specific configurations
 * for Stripe and PayPal integrations. Implements security best practices and
 * comprehensive error handling.
 * 
 * @module paymentConfig
 * @version 1.0.0
 */

/**
 * Payment provider types
 * @enum {string}
 */
export const PaymentProvider = Object.freeze({
  STRIPE: 'stripe',
  PAYPAL: 'paypal',
});

/**
 * Payment environment modes
 * @enum {string}
 */
export const PaymentEnvironment = Object.freeze({
  TEST: 'test',
  PRODUCTION: 'production',
});

/**
 * Donation frequency types
 * @enum {string}
 */
export const DonationFrequency = Object.freeze({
  ONE_TIME: 'one_time',
  MONTHLY: 'monthly',
  QUARTERLY: 'quarterly',
  YEARLY: 'yearly',
});

/**
 * Payment configuration error types
 * @enum {string}
 */
const ConfigErrorType = Object.freeze({
  MISSING_KEY: 'MISSING_KEY',
  INVALID_ENVIRONMENT: 'INVALID_ENVIRONMENT',
  INVALID_PROVIDER: 'INVALID_PROVIDER',
  INITIALIZATION_FAILED: 'INITIALIZATION_FAILED',
});

/**
 * Custom error class for payment configuration errors
 */
class PaymentConfigError extends Error {
  /**
   * @param {string} message - Error message
   * @param {string} type - Error type from ConfigErrorType
   * @param {Object} [context] - Additional error context
   */
  constructor(message, type, context = {}) {
    super(message);
    this.name = 'PaymentConfigError';
    this.type = type;
    this.context = context;
    this.timestamp = new Date().toISOString();
  }
}

